import React from 'react'
import LogInForm from '../components/LogInForm'
import request from '../libs/request'

const LogIn = (props) => {
    return(
        <LogInForm onSubmit={request.logIn} onLogIn={props.onLogIn()}/>
    )
}

export default LogIn;
